import React, { useRef, useState, useEffect } from 'react'
import Joi from 'joi'

function Form(props) {
  console.log(props)

  return (
    <form onSubmit={props.onSubmit}>
      {props.errors && (
        <div className="alert alert-danger" role="alert">
          {props.errors}
        </div>
      )}

      {props.children}
    </form>
  )
}

export default Form
